import React from 'react'

function Favourites(props) {
    return (
        <div>
             <thead>
                    <tr>
                        <th>Book Name</th>
                        <th>Favourites</th>
                    </tr>
                </thead>

                <tbody>
                    {/* fav */}
                    {props.info.fav.map((b)=>(
                        <tr>
                            <td>{getTitleFromBookId(b).title}</td>
                            <td><button onClick={()=>remFav(b)}>Unmark fav</button></td>
                        </tr>
                    ))}
                </tbody>


        </div>
    )
}

export default Favourites
